import React from 'react'

const Work1 = () => {
  const styles = {
    header:{
      
        backgroundImage: url('images/bora-bora-685303_1920.jpg'),
        backgroundSize: '1297px',
        backgroundAttachment: 'fixed',
        height: '30vh',
        position: relative,
      
    }
  }
  return (
    <div>
      <header>
        <h1 class=" text-white">Our Work!</h1>
    </header>
    </div>
  )
}

export default Work1
